import { FC } from 'react';
import { AppBar, Box } from '@mui/material';
import Typography from '@mui/material/Typography';
import nameCard from '../assets/Name_Card.png';

const PageHeader: FC = () => {

  return (
    <AppBar sx={{ flexDirection: 'row', justifyContent: 'space-between' }}>
      {/* Import github and linkedin logos and make them links/button */}
      <Box>
        insert logo/github/linkedin profiles
      </Box>
      <Box sx={{
        fontFamily: 'Arial',
      }}>
        {/* middle = logo */}

        <Box
        component="img"
        sx={{
          height: 233,
          width: 350,
          maxHeight: { xs: 233, md: 167 },
          maxWidth: { xs: 350, md: 250 },
        }}
        alt="Charlie Webb"
        src={ nameCard }
      />
      </Box>
      <Box>
        <Typography>settings menu OPTIONAL!</Typography>
      </Box>
    </AppBar>
  )
}

export default PageHeader;
